import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./Header.css";

const TopHeader = () => {
  return (
    <Navbar className="bg-brown" variant="dark">
      <Container>
        <Nav className="me-auto">
          <Nav.Link href="tel:+77777777777">
            <i className="icon-placeholder"></i> +7(777)777-77-77
          </Nav.Link>
          <Nav.Link href="/feedback">
            <i className="icon-placeholder"></i> Обратная связь
          </Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href="mailto:sampletext@gmail.com">
            <i className="icon-placeholder"></i> sampletext@gmail.com
          </Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
};

const MainHeader = () => {
  return (
    <Navbar className="bg-white" expand="lg">
      <Container>
        <Navbar.Brand href="/">
          <i className="icon-placeholder"></i> Лого
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/catalog">Каталог</Nav.Link>
            <Nav.Link href="/about">О нас</Nav.Link>
            <Nav.Link href="/account">Личный кабинет</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="/cart">
              <i className="icon-placeholder"></i> Корзина
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

const Header = () => {
  return (
    <>
      <TopHeader />
      <MainHeader />
    </>
  );
};

export default Header;
